import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    height: 60px;
`

const Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    justify-content: space-between;
`
const Left = styled.div`
    flex: 1
`
const Center = styled.div`
    flex: 1
`
const Right = styled.div`
    flex: 1
`
 
const Navbar = () => {
  return (
    <div>
        <Container>
            <Wrapper>
                <Left>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Illum eos natus cupiditate suscipit non commodi consequatur dicta ipsa quam optio officiis dolorum, aut necessitatibus reprehenderit saepe dolor provident harum facere?</Left>
                <Center>center</Center>
                <Right>right</Right>
            </Wrapper>
        </Container>
    </div>
  )
}

export default Navbar
